import "./App.css";
import {
  Inject,
  ScheduleComponent,
  Day,
  Week,
  WorkWeek,
  Month,
  Agenda,
} from "@syncfusion/ej2-react-schedule";
import { CalenderComponent } from "@syncfusion/ej2-react-calendars";
function Calender() {
  return (
    <ScheduleComponent currentView="Month">
      <Inject services={[Day, Week, WorkWeek, Month, Agenda]} />
    </ScheduleComponent>
  );
}

export default Calender;
